import React, { useState } from 'react';
import { QElementComponent, useQElementStyle } from '../qelements';

/**
 * Basic Template - Parent-Child Relationships
 * 
 * This template demonstrates the core QElements functionality:
 * - Parent components control base styles
 * - Children inherit parent styles automatically
 * - Children can override specific properties
 * - Independent children with shared base
 * 
 * Edit this template to experiment with QElements!
 */

const BasicTemplate = () => {
  const { updateParent } = useQElementStyle('basic_template');
  const [parentStyle, setParentStyle] = useState({
    padding: 20,
    margin: 10,
    backgroundColor: '#f0f0f0',
    borderRadius: 8,
    border: '2px solid #ddd'
  });
  const [activeTheme, setActiveTheme] = useState('default');
  const [activeBorder, setActiveBorder] = useState('default');

  const handleParentUpdate = (newStyle: any, themeName?: string, borderName?: string) => {
    const updatedStyle = { ...parentStyle, ...newStyle };
    setParentStyle(updatedStyle);
    updateParent(updatedStyle);
    if (themeName) setActiveTheme(themeName);
    if (borderName) setActiveBorder(borderName);
  };

  return (
    <div style={{ marginBottom: '2rem' }}>
      <h3>🎯 Basic Template - Parent-Child Demo</h3>
      <p>This parent controls the base styles for all children with the same elementId.</p>

      {/* Parent Controls */}
      {/* Status Display */}
      <div style={{ 
        marginBottom: '1rem', 
        padding: '0.75rem', 
        backgroundColor: '#f8f9fa', 
        borderRadius: '6px',
        border: '1px solid #e9ecef',
        fontSize: '0.875rem'
      }}>
        <strong>Current State:</strong> Theme: <span style={{ color: '#007bff' }}>{activeTheme}</span> | 
        Border: <span style={{ color: '#dc3545' }}>{activeBorder}</span> | 
        Padding: <span style={{ color: '#28a745' }}>{parentStyle.padding}px</span>
      </div>

      <div style={{ marginBottom: '1rem', display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        <button 
          onClick={() => handleParentUpdate({ backgroundColor: '#e3f2fd' }, 'blue')}
          style={{ 
            backgroundColor: activeTheme === 'blue' ? '#e3f2fd' : '#f8f9fa',
            border: activeTheme === 'blue' ? '2px solid #2196f3' : '1px solid #dee2e6',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            transition: 'all 0.2s ease'
          }}
        >
          Blue Theme
        </button>
        <button 
          onClick={() => handleParentUpdate({ backgroundColor: '#f3e5f5' }, 'purple')}
          style={{ 
            backgroundColor: activeTheme === 'purple' ? '#f3e5f5' : '#f8f9fa',
            border: activeTheme === 'purple' ? '2px solid #9c27b0' : '1px solid #dee2e6',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            transition: 'all 0.2s ease'
          }}
        >
          Purple Theme
        </button>
        <button 
          onClick={() => handleParentUpdate({ backgroundColor: '#e8f5e8' }, 'green')}
          style={{ 
            backgroundColor: activeTheme === 'green' ? '#e8f5e8' : '#f8f9fa',
            border: activeTheme === 'green' ? '2px solid #4caf50' : '1px solid #dee2e6',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            transition: 'all 0.2s ease'
          }}
        >
          Green Theme
        </button>
        <button 
          onClick={() => handleParentUpdate({ padding: 30, borderRadius: 15 })}
          style={{
            padding: '8px 16px',
            backgroundColor: '#f8f9fa',
            border: '1px solid #dee2e6',
            borderRadius: '4px',
            cursor: 'pointer',
            transition: 'all 0.2s ease'
          }}
        >
          More Padding
        </button>
        <button 
          onClick={() => handleParentUpdate({ border: '3px solid #ff6b6b' }, undefined, 'red')}
          style={{ 
            backgroundColor: activeBorder === 'red' ? '#ffebee' : '#f8f9fa',
            border: activeBorder === 'red' ? '2px solid #f44336' : '1px solid #dee2e6',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            transition: 'all 0.2s ease'
          }}
        >
          Red Border
        </button>
      </div>

      {/* Parent Container */}
      <QElementComponent elementId="basic_template">
        <h4>Parent Container</h4>
        <p>I'm the parent! My styles affect all my children.</p>

        {/* Child Components */}
        <BasicChild />
        <BasicChild />
        <BasicChild />
      </QElementComponent>
    </div>
  );
};

const BasicChild = () => {
  const { override, reset, getComputed } = useQElementStyle('basic_template');
  const [overrides, setOverrides] = useState<any>({});

  const handleOverride = (newOverrides: any) => {
    const updatedOverrides = { ...overrides, ...newOverrides };
    setOverrides(updatedOverrides);
    override(updatedOverrides);
  };

  const handleReset = () => {
    setOverrides({});
    reset();
  };

  const computedStyles = getComputed();

  return (
    <div style={{ 
      margin: '10px 0', 
      padding: '10px', 
      border: '1px dashed #999',
      backgroundColor: 'rgba(255,255,255,0.5)'
    }}>
      <h5>Child Component</h5>
      <p>I inherit from my parent but can override specific properties!</p>

      {/* Child Controls */}
      <div style={{ marginBottom: '10px', display: 'flex', gap: '5px', flexWrap: 'wrap' }}>
        <button onClick={() => handleOverride({ backgroundColor: '#ffeb3b' })}>
          Yellow BG
        </button>
        <button onClick={() => handleOverride({ backgroundColor: '#4caf50', color: 'white' })}>
          Green BG
        </button>
        <button onClick={() => handleOverride({ padding: 15, borderRadius: 20 })}>
          Custom Padding
        </button>
        <button onClick={() => handleOverride({ border: '2px solid #2196f3' })}>
          Blue Border
        </button>
        <button onClick={handleReset}>
          Reset to Parent
        </button>
      </div>

      {/* Style Inspector */}
      <details style={{ fontSize: '12px', marginTop: '10px' }}>
        <summary>Current Computed Styles</summary>
        <pre style={{ fontSize: '10px', background: '#f5f5f5', padding: '5px' }}>
          {JSON.stringify(computedStyles, null, 2)}
        </pre>
      </details>
    </div>
  );
};

export default BasicTemplate;
